import React, { useEffect } from "react";
import { connect } from "react-redux";
import CarouselCardsComponent from "../Components/CarouselCardsComponent/CarouselCardsComponent";
import NavbarComponent from "../Components/Shared/NavbarComponent/NavbarComponent";
import { getMostPopular } from "../redux/MostPopular/MostPopular.Action";

export default function Home(props) {
  const handleUploadVideo = () => {
    axios({
      method: "get",
      url: "https://api.themoviedb.org/3/movie/top_rated",
      data: form_data,
      headers: {
        "content-type": "multipart/form-data",
        apiKey: process.env.REACT_APP_SUB_API_KEY,
      },
    })
      .then((res) => {
        console.log(res);
      })
      .catch((err) => {
        console.log("test errrorr", err);
      });
  };
  useEffect(() => {
    handleUploadVideo();
  }, []);
  // console.log(handleUploadVideo, "pppppppppppppppppppppppppp");
  return (
    <div>
      <NavbarComponent />
      <CarouselCardsComponent />
    </div>
  );
}

